import './Intro.css';
import pfp from'../extra/pfp.jpeg'

function Intro() {
  return (
    <div className="Intro">
        <div id="header">
            <img id="pfp" src={pfp}></img>
            <div id="desc">
                <h1>Camille Gandotra</h1>
                <h2>Student at UC Santa Cruz studying Computer Engineering. Interested in Parallel Computing and Software Development.</h2>

            </div>
        </div>
    </div>
  );
}

export default Intro;
